import React from 'react';
import s from './Home.module.css';

function Home() {
    return (
        <div className={s.home}>
            <span>
                Բարև ես Տիգրանեմ Խերանյանն եմ!
            </span>
            <span>
                ես սկսնակ frontend ծրագրավորող եմ, ծրագրավորմամբ զբաղվում եմ արդեն 1 տարի, և նպատակ ունեմ 
            </span>
        </div>
    );
}

export default Home;
